le the Underground is comprised of Frenchmen. The plot is mainly an excuse for the Z-A-Z team's fondness for joke-a-minute lampoonery, skewering cinematic targets ranging from The Blue Lagoon (1980) to The Wizard of Oz (1939). As in Z-A-Z's other efforts, Top Secret! scores its biggest yocks when invoking cliches that we never realized were cliches-and falls on its face whenever attempting a too-obvious gag (the biggest clinker: that pigeon statue in the park). Everyone has his or her favorite bits in this film: our faves include the resistance fighter named Deja Vu (\"Haven't we met somewhere before?\"), Kilmer's horrible nightmare while being tortured (he arrives too late to take final exams), the army-booted cow, the sensitive Pinto, and the East German National Anthem, sung to the tune of the Shorewood (Wisconsin) High School marching song. But let's say no more: comedy of this nature is designed to be seen, not written or read about."}]},"longBylineText":{"runs":[{"text":"YouTube Movies","navigationEndpoint":{"clickTrackingParams":"CJ4BEIszIhMIzIiQ9P2y6AIVceI4Ch2kmQ1j","commandMetadata":{"webCommandMetadata":{"url":"/channel/UClgRkhTL3_hImCAmdLfDE4g","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":3611}},"browseEndpoint":{"browseId":"UClgRkhTL3_hImCAmdLfDE4g"}}}]},"shortBylineText":{"runs":[{"text":"YouTube Movies","navigationEndpoint":{"clickTrackingParams":"CJ4BEIszIhMIzIiQ9P2y6AIVceI4Ch2kmQ1j","commandMetadata":{"webCommandMetadata":{"url":"/channel/UClgRkhTL3_hImCAmdLfDE4g","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":3611}},"browseEndpoint":{"browseId":"UClgRkhTL3_hImCAmdLfDE4g"}}}]},"lengthText":{"accessibility":{"accessibilityData":{"label":"1 hour, 30 minutes"}},"simpleText":"1:30:06"},"navigationEndpoint":{"clickTrackingParams":"CJ4BEIszIhMIzIiQ9P2y6AIVceI4Ch2kmQ1jMgpnLWhpZ2gtcm1vWg9GRXdoYXRfdG9fd2F0Y2g=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=KLBBWSumQzI","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"
